        const getData = async () => {
            if (data) {
                try {
                    const response = await axios.get(
                        'https://www.superheroapi.com/api.php/10221283496530128/search/ironman'
                    );
                    console.log(response);
                } catch (error) {
                    console.log(error);
                }
            }
        };
        getData();
    }, []);

    return (
        <>
            <h1>Heroe</h1>
        </>
    );
}
